import React from "react";
import Api from './api';

   const Card=()=>{
        return (
            {
                ...(Api.map((curEle)=>{
                    return(
                        <>
            <div>
              <h2>{curEle.name}</h2>
              <img src={curEle.img} alt="image" />
              <p>{curEle.tel}</p>
            </div>
                        </>
                    )
                }))
            }
            
          )
        }
export default Card;
